import React from 'react';
import styled from '@emotion/styled';

const List = styled.ul `
    background-color: #1c1c1c;
    margin: 0;
    padding: 0;
    overflow: hidden;
`;

const Item = styled.li`
    text-decoration: none;
    background-color: red;
    border: none;
    color: white;
    font-size: 38px;
    height: 100%;
    width: 40px;
    padding: 10px 10px 10px 10px;
    margin: 0px 5vw 0px 5vw;
    &:hover {
        color: lightblue;
    }
`;
const Word = styled.a`

`;

function Navbar() {
    return (
        <React.Fragment>
            <List>
                <Item><Word>About</Word></Item>
                <Item><Word>Info</Word></Item>
                <Item><Word>Projects</Word></Item>
            </List>
        </React.Fragment>
    );
}
export default Navbar;
